import Contact from './components/Contact';
import Navbar from './components/Navbar';


import './App.css';

function App() {
  return (
    <div>
      <Navbar />
      <Home />
      <Work />
      <Portfolio />
      <Profile />
      <About />
      <Socialmedia />
      <Footer />
    </div>
  );
}

export default App;
